void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    ivec2 c = ivec2(fragCoord);

    if((c.x >= (embed_texture+2)*embed_channels/4) || (c.y >= (embed_texture+2)) || iFrame > 8) discard;

    int ch = c.x / (embed_texture + 2);

    c = clamp(c - 1 - ivec2(ch*(embed_texture + 2), 0), 0, embed_texture-1);

    int idx = ch + (c.x*embed_channels + c.y*embed_channels*embed_texture)/4;

    fragColor = embed0[idx];
}

